import React from "react";
import { Link } from "react-router-dom";

import "./TopNav.css";

const TopNav = () => {
  return (
    <nav className="mainConatiner">
      <ul>
        <li>
          <Link go_btn to="community">
            커뮤니티
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default TopNav;
